import React from "react";
import "./footer.styles.css";
import twitter from '../../media/twitter.jpeg'
import fb from '../../media/facebook.png'
import git from '../../media/github.png'
import insta from '../../media/instagram.png'
import linked from '../../media/linkedin.png'


function Footer(){
    return(

        <div className="footer">
            <img src={twitter} alt="h" />
            <img src={fb} alt="g" />
            <img src={insta} alt="f" />
            <img src={linked} alt="d" />
            <img src={git} alt="s" />
        </div>



    )
}


export default Footer;
